import React, { useState } from "react";
import axios from "axios";

function ButtonCriterion() {
  const [criteriaTitle, setCriteriaTitle] = useState([]);
  const [criteriaDataType, setCriteriaDataType] = useState();
  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:3000/criterion");
      console.log(response.data);
    } catch (error) {
      console.error("Error fetching data", error);
    }
  };

  return (
    <div>
      <h2>Kriterler</h2>
      <button onClick={fetchData}>kriterleri tablosunu gör</button>

      {/* Buraya kriterlerle ilgili diğer bileşenleri veya işlevselliği ekleyebilirsiniz */}

      <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
        RAPORLA
      </button>
    </div>
  );
}

export default ButtonCriterion;
